import React from 'react'
import { ThemeProvider, createTheme } from '@mui/material';
import { white } from '@mui/material/colors';

const AppTheme = () => {
  const theme = createTheme({
    palette: {
      primary: {
        main: "#03074f"
      },
      secondary: {
        main: white[500]
      }
    },
    typography: {
      navbar: {
        fontSize: '5rem'
      }
    }
  })

  return { theme, ThemeProvider };
}

export default AppTheme;
